import React, { useEffect, useRef, useState } from 'react';
import { fabric } from 'fabric';

const FabricCanvas = ({ setDataUrl, dataUrl }) => {
    const canvasRef = useRef(null);
    const fabricCanvasRef = useRef(null);
    const deleteButtonRef = useRef(null);

    const handleDragOver = (e) => {
        e.preventDefault();
    };

    const handleDrop = (e) => {
        e.preventDefault();
        const dragData = e.dataTransfer.getData('application/json');
        console.log("Drag Data:", dragData); // 检查拖拽数据
        const { type, url } = JSON.parse(dragData);
        console.log("Type:", type, "URL:", url); // 检查类型和 URL

        if (type === 'library') {
            fabric.Image.fromURL(
                url,
                (img) => {
                    img.set({
                        selectable: true,
                        scalable: true,
                        hasControls: true,
                    });
                    img.scale(0.25);
                    img.setCoords();


                    fabricCanvasRef.current.add(img);
                    saveCanvasState();
                },
                { crossOrigin: 'anonymous' }
            );
        }
    };


    const saveCanvasState = () => {
        const data = JSON.stringify(fabricCanvasRef.current.toDatalessJSON());
        sessionStorage.setItem('canvasState', data);
    };

    const loadCanvasState = () => {
        const data = sessionStorage.getItem('canvasState');
        if (data) {
            fabricCanvasRef.current.loadFromJSON(data, () => {


            });
        }
    };

    useEffect(() => {
        if (!fabricCanvasRef.current) {
            fabricCanvasRef.current = new fabric.Canvas(canvasRef.current, {
                width: window.innerHeight * 0.6,
                height: window.innerHeight * 0.6,
                selection: true,
                preserveObjectStacking: true,
                interactive: true,
            });

            // 创建删除按钮
            deleteButtonRef.current = new fabric.Text('X', {
                fontFamily: 'Arial',
                fontSize: 20,
                selectable: false,
                hasControls: false,
                hasBorders: false,
                originX: 'center',
                originY: 'center',
                hoverCursor: 'pointer',
                visible: false, // 初始隐藏
            });
            fabricCanvasRef.current.add(deleteButtonRef.current);

            fabricCanvasRef.current.on('object:selected', handleObjectSelected);
            fabricCanvasRef.current.on('selection:cleared', handleSelectionCleared);

            loadCanvasState();
        }

        return () => {
            fabricCanvasRef.current.off('object:selected', handleObjectSelected);
            fabricCanvasRef.current.off('selection:cleared', handleSelectionCleared);
        };
    }, []);

    const handleObjectSelected = (e) => {
        if (e.target !== deleteButtonRef.current) {
            const obj = e.target;
            const deleteButton = deleteButtonRef.current;

            deleteButton.set({
                left: obj.left + obj.width / 2,
                top: obj.top - 20,
                visible: true,
            });

            fabricCanvasRef.current.renderAll();
        }
    };

    const handleSelectionCleared = () => {
        deleteButtonRef.current.set('visible', false);
        fabricCanvasRef.current.renderAll();
    };

    const handleDeleteButtonClick = () => {
        const activeObject = fabricCanvasRef.current.getActiveObject();
        if (activeObject) {
            fabricCanvasRef.current.remove(activeObject);
            fabricCanvasRef.current.remove(deleteButtonRef.current);
            fabricCanvasRef.current.discardActiveObject().renderAll();
            saveCanvasState();
        }
    };


    useEffect(() => {
        const saveCanvasToDataUrl = () => {
            if (fabricCanvasRef.current) {
                const dataURL = fabricCanvasRef.current.toDataURL({
                    format: 'png',
                    multiplier: 1,
                    quality: 1,
                });
                setDataUrl(dataURL);
            }
        };

        const canvasStateChangeListener = () => {
            saveCanvasToDataUrl();
            saveCanvasState();
        };

        const objectModifiedListener = (event) => {
            canvasStateChangeListener(); // Update canvas state on object modification
        };

        if (fabricCanvasRef.current) {
            fabricCanvasRef.current.on('object:added', canvasStateChangeListener);
            fabricCanvasRef.current.on('object:removed', canvasStateChangeListener);
            fabricCanvasRef.current.on('object:modified', objectModifiedListener); // Listen for object modification
        }

        return () => {
            if (fabricCanvasRef.current) {
                fabricCanvasRef.current.off('object:added', canvasStateChangeListener);
                fabricCanvasRef.current.off('object:removed', canvasStateChangeListener);
                fabricCanvasRef.current.off('object:modified', objectModifiedListener); // Remove event listener
            }
        };
    }, [setDataUrl]);




    return (
        <div
            onDragOver={handleDragOver}
            onDrop={handleDrop}
            style={{ border: '1px solid black', maxWidth: '60vh', maxHeight: '60vh', position: 'relative', backgroundColor: 'white' }}
        >
            <canvas
                ref={canvasRef}
                width={512}
                height={512}
                style={{ width: '100%', height: '100%' }}
            ></canvas>
        </div>
    );
};

export default FabricCanvas;
